pub enum Event {

    #[doc =
      "keyboard mapping\n\nThis event provides a file descriptor to the client which can be\nmemory-mapped to provide a keyboard mapping description.\n\nFrom version 7 onwards, the fd must be mapped with MAP_PRIVATE by\nthe recipient, as MAP_SHARED may fail."]
    Keymap {
        format: KeymapFormat,
        fd: ::std::os::unix::io::RawFd,
        size: u32,
    },

    #[doc =
      "enter event\n\nNotification that this seat's keyboard focus is on a certain\nsurface."]
    Enter {
        serial: u32,
        surface: super::wl_surface::WlSurface,
        keys: Vec<u8>,
    },

    #[doc =
      "leave event\n\nNotification that this seat's keyboard focus is no longer on\na certain surface.\n\nThe leave notification is sent before the enter notification\nfor the new focus."]
    Leave {
        serial: u32,
        surface: super::wl_surface::WlSurface,
    },

    #[doc =
      "key event\n\nA key was pressed or released.\nThe time argument is a timestamp with millisecond\ngranularity, with an undefined base."]
    Key {
        serial: u32,
        time: u32,
        key: u32,
        state: KeyState,
    },

    #[doc =
      "modifier and group state\n\nNotifies clients that the modifier and/or group state has\nchanged, and it should update its local state."]
    Modifiers {
        serial: u32,
        mods_depressed: u32,
        mods_latched: u32,
        mods_locked: u32,
        group: u32,
    },

    #[doc =
      "repeat rate and delay\n\nInforms the client about the keyboard's repeat rate and delay.\n\nThis event is sent as soon as the wl_keyboard object has been created,\nand is guaranteed to be received by the client before any key press\nevent.\n\nNegative values for either rate or delay are illegal. A rate of zero\nwill disable any repeating (regardless of the value of delay).\n\nThis event can be sent later on as well with a new value if necessary,\nso clients should continue listening for the event past the creation\nof wl_keyboard.\n\nOnly available since version 4 of the interface"]
    RepeatInfo {
        rate: i32,
        delay: i32,
    },
}

